in_forth: |-
  \import src/compiler/forthlib/iolib.fth

  : prompt-out ." > " ;
  : prompt-in ." < " cr ;
  : print-prompt ( -- )
    prompt-out ." What is your name?" cr ;

  : print-hello-to ( addr -- )           \ prints "Hello, {str}", where str is pointed by addr
